import  Axios  from 'axios'
import React, { useEffect } from 'react'

export default function AdminPage() {
  useEffect(() => {
    Axios.get("http://localhost:8000?user", {
      withCredentials:true
    }).then(res => {
      console.log(res.data);
    })
  }, [])
  return (
    <div>AdminPage</div>
  )
}
